import Top from "./components/Top.js";
import Home from "./pages/Home";
import About from "./pages/About.js";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" index={<Home/>}/>
          <Route path="/About" index={<Home/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
